import React from 'react';

import { withStyles, makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';

import Button from '@material-ui/core/Button';

import ArrowDownwardIcon from '@material-ui/icons/ArrowDownward';
import ArrowUpwardIcon from '@material-ui/icons/ArrowUpward';

const TableGame = () => {

    const StyledTableCell = withStyles((theme) => ({
        head: {
            backgroundColor: theme.palette.common.white,

        },
        body: {
            fontSize: 14,
        },
    }))(TableCell);

    const StyledTableRow = withStyles((theme) => ({
        root: {
            '&:nth-of-type(odd)': {
                backgroundColor: theme.palette.action.hover,
            },
        },
    }))(TableRow);

    function createData(name, calories, fat, carbs, protein) {
        return { name, calories, fat, carbs, protein };
    }


    const useStyles = makeStyles({
        table: {
            minWidth: 700,
        },
    });
    document.title = "Table Game"

    return (
        <>
            <h1 style={{ marginTop: "100px", fontSize: "20px" }}>Table Game</h1>
            <Button
                href="/movie/tablemovie/create"
                variant="contained"
                color="primary"
                style={{ marginTop: "1px", marginLeft: "85%", fontSize: "15px", width: "150px", backgroundColor: "gold", color: "black", fontWeight: 'bolder' }}
            > Add Game
                 </Button>
            <TableContainer component={Paper} style={{ marginTop: "20px", marginBottom: "50px" }}>
                <Table className="table" aria-label="customized table">
                    <TableHead>
                        <TableRow>
                            <StyledTableCell>Actions</StyledTableCell>
                            <StyledTableCell>Name</StyledTableCell>
                            <StyledTableCell>Genre</StyledTableCell>
                            <StyledTableCell>SinglePlayer</StyledTableCell>
                            <StyledTableCell>Multiplayer</StyledTableCell>
                            <StyledTableCell>Platform</StyledTableCell>
                            <StyledTableCell>Release</StyledTableCell>
                            <StyledTableCell>Image_URL</StyledTableCell>
                        </TableRow>
                    </TableHead>
                    <TableBody>

                        <StyledTableCell align="left"></StyledTableCell>
                        <StyledTableCell align="left"></StyledTableCell>
                        <StyledTableCell align="left"></StyledTableCell>
                        <StyledTableCell align="left"></StyledTableCell>
                        <StyledTableCell align="left"></StyledTableCell>
                        <StyledTableCell align="left"></StyledTableCell>
                        <StyledTableCell align="left"></StyledTableCell>
                        <StyledTableCell align="left"></StyledTableCell>
                    </TableBody>
                </Table>
            </TableContainer>
        </>
    )
}
export default TableGame;
